// src/pages/Dashboard.js
import React from 'react';
import { Link } from 'react-router-dom';
import ProfileMenu from '../components/ProfileMenu';

function Dashboard() {
  return (
    <div className="container mt-5">
      <h2>Bienvenido al Panel Principal</h2>
      <p>Desde aquí puedes gestionar tus horarios y configuraciones.</p>
      <div className="mt-4">
        <Link to="/schedules" className="btn btn-primary me-2">Ver Horarios</Link>
        <Link to="/settings" className="btn btn-secondary">Configuración</Link>
      </div>
      {/* Posiciona el ProfileMenu en la esquina derecha */}
      <div style={{ position: 'absolute', top: '20px', right: '20px' }}>
        <ProfileMenu />
      </div>
    </div>
  );
}

export default Dashboard;
